import React from 'react'
import {
    Card,
    makeStyles,
    CardContent,
    Typography,
  } from "@material-ui/core";

  const useStyles = makeStyles((theme) => ({
    button: { ...theme.mybutton },
    nav: { ...theme.myNav },
    small: {
      display: "none",
      [theme.breakpoints.up("sm")]: {
        display: "block",
      },
    },
    large: {
      display: "block",
      [theme.breakpoints.up("sm")]: {
        display: "none",
      },
    },
    textarea: {
      ...theme.textarea,
    },
    text: {
      fontFamily: "Rosarivo",
      fontSize: "50px",
      padding: theme.spacing(3),
      color: "#1B224A",
    },
    text1: {
      fontFamily: "Rosarivo",
      fontSize: "20px",
      padding: theme.spacing(1),
      color: "#1B224A",
      textAlign:'center'
    },
    root: {
      maxWidth: 445,
      textAlign: "center",
    },
  }));
function Login() {
    const classes = useStyles();
    return (
        <form className={classes.root}>
            <input type='text' />
            <input type='password'/>
        </form>
    )
}

export default Login
